import React, { Component } from 'react';
import Navbar from './Navbar';
import { Container } from 'react-bootstrap'

class Home extends Component {
    render() {
        return (
            <Container fluid>
                {this.props.children}
                <Navbar></Navbar>
            </Container>
        );
    }
}

export default Home;
